import React from "react";
import ReactDOM from "react-dom";

ReactDOM.render(
  <div>
    <h1>I am Sosenk</h1>
    <ul>
      <li>I love anime</li>
      <li>I am God</li>
      <li>Pro at valo</li>
    </ul>
  </div>,
  document.getElementById("root")
);
